var nameList = [
    'Ayush', 'Snehil', 'Sachin', 'Dev',
    'Kriti', 'Shikher', 'Kartik', 'Pranjal', 'Akshat', 'Tanu',
    'Manu', 'Ananya', 'Utkarsh', 'Ram', 'Gita', 'Subodh', 'Shreya',
    'Shankardayal', 'Renu', 'Shakshi', 'Anurag', 'Bablu', 'Kanhiya', 'Gungun',
    'Vipul', 'Ashish'];
  export  function generateRandomNames() {
  return  nameList[Math.floor(Math.random() * nameList.length)];
};
